import styled from 'styled-components';

export const BackgroundWrapper = styled.div`
  justify-self: center;
  align-items: center;
  border-radius: 15px;
  background-color: black;
  width: 500px;
  height: 500px;
`;

export const SelectionCard = styled.div``;

export const SubwayPageButton = styled.div``;

export const StarbucksPageButton = styled.div``;
